import axios from "axios";
const cors = require('cors');


const baseURL = "http://localhost:2410";

function get(url){
    return axios.get(baseURL + url )
}

function post(url,obj){
    return fetch(url, { method: "POST", body: obj })
    //  axios.post(baseURL+url, obj);
}

export default {
    get,
    post,
}
